import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import DishList from "./components/DishList";  // Component for the list
import DishDetails from "./components/DishDetails";  // Component for details
// import SearchBar from "./components/SearchBar"; // Search box component

const App = () => {
    return (
        <Router>
            <header>
                <h1>Indian Cuisine Dish Explorer</h1>
                <SearchBar />  {/* Add Search bar */}
            </header>
            <Switch>
                <Route path="/" exact component={DishList} />
                <Route path="/dish/:id" component={DishDetails} />
            </Switch>
        </Router>
    );
};

export default App;
